import React,{Component} from "react";
import Slider from "react-slick";
 
export default class Fade extends Component {
  render() {
    const settings = {
      dots: true,
      fade: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <Slider {...settings}>
          <div>
            <img src={require("../slider/img/slider_test-1.jpg")} />
          </div>
          
        </Slider>
      </div>
    );
  }
}
